import React from 'react';
import axios from 'axios'
// @ts-ignore
import IContact from "./models/IContact"

interface IProps {}

interface IState {
    IContact: IContact[]
}

class ContactList extends React.Component<IProps, IState>{

    constructor(props:IProps) {
        super(props);
        this.state ={
             IContact :[] as IContact[]
        }
    }
componentDidMount(): void {
        let dataUrl:string='https://reqres.in/api/users?page=1https://reqres.in/api/users?page=1';
        axios.get(dataUrl).then((response)=> {
            this.setState({
                IContact:response.data
            })

        }).catch((error) => {
           console.error(error);
        });
}

    render() {
        return (
            <React.Fragment>
               <pre>{JSON.stringify(this.setState.IContact)}</pre>
            </React.Fragment>
        );
    }
}
export default ContactList;
